async function getBookInfo(url){
	let searchUrl = new URL(url);
	const res = await request({
		url: searchUrl.href,
		method: "GET",
		cache: "no-cache",
		headers: headers
	});

	const bookInfo = {};

	if(!res){
		return null;
	}

	let p = new DOMParser();

	let doc = p.parseFromString(res, "text/html");

	let $ = s => doc.querySelector(s);

	//豆瓣评分
	let rating = $("div#interest_sectl div div strong")?.textContent.replace(/\s/g,"");

	//console.log("bookInfo子函数创建成功");	
	
	bookInfo.rating = rating;

	//console.log(bookInfo);
	//console.log("断点：异步函数内:bookinfo赋值成功");	
	//console.log(bookInfo.rating);
	//console.log("断点：异步函数内:bookinfo.rating赋值成功");	

	return bookInfo;
}

